query AccountQueriesQuery {
  user {
    accountAvailable
    accountToBePaid
    accountTotal
    accountWithheld
    id
  }
}

query utilsQuery {
  user {
    id
    accountAvailable
    accountTotal
  }
}

mutation ApproveLoanPageMutation(
  $input: ApproveLoanInput!
) {
  approveLoan(input: $input) {
    error
    loan {
      id
      status
    }
  }
}

query utilsFintechQuery {
  user {
    id
    accountAvailable
    accountTotal
  }
}

subscription SiderFintechUserSubscription {
  user_subscribe {
    id
    accountAvailable
    accountToBePaid
    accountTotal
    accountWithheld
  }
}

query ScheduledPaymentRowQuery(
  $loan_gid: ID!
) {
  scheduledPaymentsbyLoanId(loan_gid: $loan_gid) {
    id
    loan_id
    amortize
    status
    scheduledDate
  }
}
